package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verify that setBirthDate accepts a valid LocalDate and stores it, as confirmed by calling getBirthDate")
	void testSetBirthDateWithValidLocalDate() {
		instance.setBirthDate(LocalDate.of(2020, 1, 1));
	}

	@Test
	@DisplayName("Verify that setBirthDate accepts null as input, as confirmed by calling getBirthDate returning null")
	void testSetBirthDateWithNull() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Verify that setType sets the PetType and getType returns it")
	void testSetTypeAndGetType() {
		instance.setBirthDate(new PetType());
	}

	@Test
	@DisplayName("Verify that addVisit adds a Visit object to the Pet's visits collection, as confirmed by checking getVisits")
	void testAddVisitToPet() {
		instance.setBirthDate(new Visit());
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the birthDate set on the Pet object")
	void testGetBirthDateReturnsSetValue() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2020, 5, 15), result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns null when birthDate has not been set")
	void testGetBirthDateReturnsNullWhenNotSet() {
		var result = instance.getBirthDate();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns null when the type field has not been initialized or is set to null")
	void testGetTypeReturnsNullWhenNotSet() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that setType handles null input by setting the type field to null without throwing exceptions")
	void testSetTypeWithNull() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Verifies that getVisits returns an empty collection when no visits have been added")
	void testGetVisitsReturnsEmptyCollection() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getVisits returns a collection containing visits added via addVisit")
	void testGetVisitsReturnsAddedVisit() {
		var result = instance.getVisits(null);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getVisits returns a collection containing multiple visits added via addVisit")
	void testGetVisitsReturnsMultipleVisits() {
		var result = instance.getVisits(null, null);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that addVisit handles null visit input without throwing exceptions")
	void testAddVisitHandlesNullVisit() {
		instance.addVisit("null");
	}

}
